import React, {Component} from 'react'
import { Link, withRouter } from 'react-router-dom'
import { Menu } from 'antd';

import './header.less'
/*
头部组件
 */
const { SubMenu } = Menu
class Header extends Component{
    render(){
        const url = this.props.history.location.pathname.split('/')
        const nowKey = url[url.length-1]
        return(
            <Menu mode="horizontal" selectedKeys={[nowKey]}>
                <Menu.Item key="home"><Link to={'/'}>首页</Link></Menu.Item>
                <SubMenu key="tools" title="小工具">
                    <Menu.Item key="favorites"><Link to={'/tools/favorites'}>收藏夹</Link></Menu.Item>
                </SubMenu>
            </Menu>
        )
    }
}

export default withRouter(Header)
